●商品サイズ：幅240×奥行450×高さ10mm。●商品重量：0.98kg。●梱包数：1梱包。 ●シンプルなデザインは、様々なお部屋の雰囲気に溶け込みます。●キッチンはもちろん、玄関先、ベットサイド、ソファの足元に置いたり、様々な場面で活躍できるインテリアマット。 ●ドラム式洗濯機には絶対にご使用にならないでください。●マットに飛び乗ったり、床面が濡れていたりするとすべる原因となりますのでご注意ください。●この商品の裏面にはすべり止め加工が施されていますので、塩化ビニール系の床材で長時間使用するとすべり止め加工の成分が反応し床材が変色する事がございます。<style type="text/css">
